    'help.HowLongWillMyPostingAppearOnBrand_contentNew': '\u05DB\u05E2\u05EA \u05EA\u05D5\u05E7\u05E3 \u05D4\u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05D1-OLX \u05E4\u05D2 \u05D0\u05D7\u05E8\u05D9 <<NUMBER>> \u05D9\u05DE\u05D9\u05DD. \u05DC\u05D0\u05D7\u05E8 \u05DE\u05DB\u05DF \u05D4\u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05DE\u05D5\u05E1\u05E8\u05D5\u05EA \u05DE\u05D4\u05D0\u05EA\u05E8. \u05E2\u05DC\u05D9\u05DA \u05D7\u05DC\u05D4 \u05D4\u05D0\u05D7\u05E8\u05D9\u05D5\u05EA \u05DC\u05D4\u05E1\u05E8\u05EA \u05D4\u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05DE\u05D4\u05D0\u05EA\u05E8 \u05DC\u05D0\u05D7\u05E8 \u05E9\u05DE\u05DB\u05E8\u05EA \u05D0\u05EA \u05E4\u05E8\u05D9\u05D8\u05DA. \u05D0\u05DD \u05DC\u05D0 \u05EA\u05E2\u05E9\u05D4 \u05D6\u05D0\u05EA, \u05DE\u05D5\u05D3\u05E2\u05EA\u05DA \u05EA\u05D5\u05E1\u05E8 \u05DC\u05D0\u05D7\u05E8 \u05EA\u05E4\u05D5\u05D2\u05EA \u05EA\u05D5\u05E7\u05E4\u05D4. \u05DC\u05D0\u05D7\u05E8 \u05D4\u05E1\u05E8\u05EA \u05DE\u05D5\u05D3\u05E2\u05EA\u05DA \u05DE\u05D4\u05D0\u05EA\u05E8 \u05EA\u05D5\u05DB\u05DC \u05DC\u05E4\u05E8\u05E1\u05DD \u05D0\u05D5\u05EA\u05D4 \u05DE\u05D7\u05D3\u05E9 \u05D9\u05E9\u05D9\u05E8\u05D5\u05EA \u05DE\u05D4\u05D0\u05EA\u05E8, \u05D0\u05DD \u05D0\u05EA\u05D4 \u05E2\u05D3\u05D9\u05D9\u05DF \u05DE\u05E6\u05D9\u05E2 \u05D0\u05EA \u05E4\u05E8\u05D9\u05D8\u05DA \u05DC\u05DE\u05DB\u05D9\u05E8\u05D4.',
