    'about.AboutText1': 'OLX\u05D4\u05D5\u05D0 \u05E4\u05DC\u05D8\u05E4\u05D5\u05E8\u05DE\u05EA \u05D4\u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05D4\u05DE\u05D5\u05D1\u05D9\u05DC\u05D4 \u05D1\u05E2\u05D5\u05DC\u05DD \u05D4\u05DE\u05EA\u05DE\u05E7\u05D3\u05EA \u05D1\u05E9\u05D5\u05D5\u05E7\u05D9\u05DD \u05DE\u05EA\u05E4\u05EA\u05D7\u05D9\u05DD, \u05D4\u05DF \u05D1\u05E0\u05D9\u05D9\u05D3 \u05D5\u05D4\u05DF \u05D1\u05D0\u05D5\u05E4\u05DF \u05DE\u05E7\u05D5\u05D5\u05DF',
    'about.AboutText2': 'OLX \u05E4\u05D5\u05E2\u05DC \u05D1\u05DB\u05DC \u05E2\u05D5\u05DC\u05DD \u05D5\u05E7\u05D9\u05D9\u05DD \u05D1\u05DC\u05DE\u05E2\u05DC\u05D4 \u05DE -40 \u05DE\u05D3\u05D9\u05E0\u05D5\u05EA',
    'about.about_Body': '<p>OLX \u05D4\u05D5\u05D0 \u05D4\u05D3\u05D5\u05E8 \u05D4\u05D1\u05D0 \u05E9\u05DC \u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05DC\u05D5\u05D7 \u05DE\u05E7\u05D5\u05D5\u05E0\u05D5\u05EA.<br /><br />OLX \u05DE\u05E1\u05E4\u05E7 \u05E4\u05EA\u05E8\u05D5\u05DF \u05E4\u05E9\u05D5\u05D8 \u05DC\u05E1\u05D9\u05D1\u05D5\u05DB\u05D9\u05DD \u05D4\u05DB\u05E8\u05D5\u05DB\u05D9\u05DD \u05D1\u05DE\u05DB\u05D9\u05E8\u05D4 ,\u05E7\u05E0\u05D9\u05D4, \u05DE\u05E1\u05D7\u05E8, \u05D1\u05D9\u05E8\u05D5\u05E8\u05D9\u05DD, \u05EA\u05D9\u05D0\u05D5\u05DE\u05D9\u05DD \u05D5\u05DE\u05E4\u05D2\u05E9\u05D9\u05DD \u05E2\u05DD \u05D0\u05E0\u05E9\u05D9\u05DD \u05D1\u05E7\u05E8\u05D1\u05EA\u05DA, \u05D9\u05D4\u05D9\u05D4 \u05D0\u05E9\u05E8 \u05D9\u05D4\u05D9\u05D4 \u05DE\u05E7\u05D5\u05DD \u05DE\u05D2\u05D5\u05E8\u05D9\u05DA <br /><br />\u05E2\u05DD OLX \u05D0\u05EA\u05D4 \u05D9\u05DB\u05D5\u05DC:<br /><ul><li>\u05DC\u05E2\u05E6\u05D1 \u05D1\u05E7\u05DC\u05D5\u05EA \u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05E2\u05E9\u05D9\u05E8\u05D5\u05EA \u05E2\u05DD \u05EA\u05DE\u05D5\u05E0\u05D5\u05EA</li><li>\u05DC\u05E9\u05DC\u05D5\u05D8 \u05D1\u05DE\u05DB\u05D9\u05E8\u05D5\u05EA, \u05D1\u05E7\u05E0\u05D9\u05D5\u05EA \u05D5\u05D1\u05E4\u05E2\u05D9\u05DC\u05D5\u05EA \u05D4\u05D7\u05D1\u05E8\u05EA\u05D9\u05EA \u05E9\u05DC\u05DA \u05D1- My OLX</li><li>\u05DC\u05D4\u05E6\u05D9\u05D2 \u05D0\u05EA \u05D4\u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05E9\u05DC\u05DA \u05D1\u05E4\u05E8\u05D5\u05E4\u05D9\u05DC \u05E9\u05DC\u05DA \u05D1\u05E8\u05E9\u05EA\u05D5\u05EA \u05D7\u05D1\u05E8\u05EA\u05D9\u05D5\u05EA (Facebook, Myspace, ...)</li><li>\u05DC\u05D2\u05DC\u05D5\u05E9 \u05DC\u05D0\u05EA\u05E8 \u05DE\u05D4\u05D8\u05DC\u05E4\u05D5\u05DF \u05D4\u05E0\u05D9\u05D9\u05D3  \u05E9\u05DC\u05DA</li><li>\u05DC\u05D4\u05E6\u05D9\u05D2 \u05D0\u05EA  OLX  \u05D1\u05E9\u05E4\u05D4 \u05D4\u05DE\u05E7\u05D5\u05DE\u05D9\u05EA \u05E9\u05DC\u05DA</li></ul><br />OLX \u05E0\u05DE\u05E6\u05D0 \u05D1\u05E9\u05D9\u05DE\u05D5\u05E9 \u05D1\u05D9\u05D5\u05EA\u05E8 \u05DE-<<QTY_COUNTRIES>> \u05DE\u05D3\u05D9\u05E0\u05D5\u05EA \u05D5\u05D1-<<QTY_LANGUAGES>> \u05E9\u05E4\u05D5\u05EA. \u05D4\u05D7\u05D1\u05E8\u05D4 \u05E0\u05D5\u05E1\u05D3\u05D4 \u05D1\u05DE\u05E8\u05E5 2006 \u05D5\u05D4\u05D9\u05D0 \u05D1\u05D1\u05E2\u05DC\u05D5\u05EA \u05E4\u05E8\u05D8\u05D9\u05EA.</p>',
