    'featured_listings.AdditionalTermsForFeaturedAds_content': '\u05EA\u05E0\u05D0\u05D9\u05DD \u05E0\u05D5\u05E1\u05E4\u05D9\u05DD \u05D0\u05DC\u05D4, \u05D1\u05EA\u05D5\u05E1\u05E4\u05EA \u05DC- <<LINK_TERMS_USE>>\u05EA\u05E0\u05D0\u05D9 \u05D4\u05E9\u05D9\u05DE\u05D5\u05E9<</LINK_TERMS_USE>> \u05E9\u05DC \u05D4\u05D0\u05EA\u05E8, \u05DE\u05DB\u05E1\u05D9\u05DD \u05D0\u05EA \u05D4\u05E9\u05D9\u05DE\u05D5\u05E9 \u05D1-\'\u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05DE\u05D5\u05D1\u05DC\u05D8\u05D5\u05EA\':<br /><ul><li>\u05DB\u05D4\u05D5\u05DB\u05D7\u05D4 \u05DC\u05EA\u05E9\u05DC\u05D5\u05DD \u05EA\u05DE\u05D5\u05E8\u05EA \u05DE\u05D5\u05D3\u05E2\u05D4 \u05DE\u05D5\u05D1\u05DC\u05D8\u05EA, OLX \u05D9\u05D5\u05E6\u05D9\u05D0 \u05E8\u05E7 "\u05D0\u05D9\u05E9\u05D5\u05E8 \u05D4\u05D6\u05DE\u05E0\u05D4" \u05E9\u05EA\u05D5\u05DB\u05DC \u05DC\u05E8\u05D0\u05D5\u05EA \u05D1\u05E1\u05D9\u05D5\u05DD \u05EA\u05D4\u05DC\u05D9\u05DA \u05D4\u05EA\u05E9\u05DC\u05D5\u05DD, \u05D5\u05D4\u05D5\u05D3\u05E2\u05EA \u05D3\u05D5\u05D0"\u05DC \u05DC\u05D0\u05D9\u05E9\u05D5\u05E8.</li><li>\u05D0\u05DD \u05DE\u05E1\u05D9\u05D1\u05D4 \u05DB\u05DC\u05E9\u05D4\u05D9, \u05D8\u05DB\u05E0\u05D9\u05EA \u05D0\u05D5 \u05D0\u05D7\u05E8\u05EA, \u05DC\u05D0 \u05DE\u05D5\u05E6\u05D2\u05EA \u05DE\u05D5\u05D3\u05E2\u05EA\u05DA \u05D1\u05D0\u05D6\u05D5\u05E8 "\u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05DE\u05D5\u05D1\u05DC\u05D8\u05D5\u05EA", \u05D4\u05D7\u05D5\u05D1\u05D4 \u05D4\u05D9\u05D7\u05D9\u05D3\u05D4 \u05E9\u05DC OLX \u05D4\u05D9\u05D0 \u05DC\u05D4\u05E6\u05D9\u05D1 \u05D0\u05EA \u05DE\u05D5\u05D3\u05E2\u05EA\u05DA \u05D1\u05D0\u05D6\u05D5\u05E8 "\u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05DE\u05D5\u05D1\u05DC\u05D8\u05D5\u05EA" \u05D1\u05D4\u05E7\u05D3\u05DD \u05D4\u05D0\u05E4\u05E9\u05E8\u05D9 \u05D1\u05D9\u05D5\u05EA\u05E8 \u05E9\u05E0\u05D5\u05DB\u05DC \u05DC\u05E2\u05E9\u05D5\u05EA \u05D6\u05D0\u05EA \u05DE\u05D1\u05D7\u05D9\u05E0\u05D4 \u05DE\u05E2\u05E9\u05D9\u05EA.</li><li>\u05D0\u05EA \u05D4\u05DE\u05E2\u05E0\u05D4 \u05E9\u05DC\u05E0\u05D5 \u05D1\u05E0\u05D5\u05E9\u05D0 \u05D7\u05D9\u05D5\u05D1\u05D9\u05DD \u05DE\u05E2\u05E0\u05D9\u05E7 \u05E1\u05E4\u05E7 \u05E9\u05D9\u05E8\u05D5\u05EA \u05E6\u05D3 \u05E9\u05DC\u05D9\u05E9\u05D9.</li><li>\u05E2\u05DC \u05E4\u05D9 \u05E9\u05D9\u05E7\u05D5\u05DC \u05D4\u05D3\u05E2\u05EA \u05D4\u05D1\u05DC\u05E2\u05D3\u05D9 \u05E9\u05DC OLX, \u05DB\u05DC \u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05E9\u05D4\u05DF \u05E4\u05D5\u05D2\u05E2\u05D5\u05EA, \u05E4\u05D5\u05E8\u05E0\u05D5\u05D2\u05E8\u05E4\u05D9\u05D5\u05EA, \u05DE\u05D4\u05D5\u05D5\u05EA \u05D3\u05D5\u05D0\u05E8 \u05D6\u05D1\u05DC (\u05DB\u05D5\u05DC\u05DC \u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05DB\u05E4\u05D5\u05DC\u05D5\u05EA), \u05DE\u05E2\u05E9\u05D9 \u05DE\u05E8\u05DE\u05D4 \u05E4\u05D5\u05D8\u05E0\u05E6\u05D9\u05D0\u05DC\u05D9\u05D9\u05DD, \u05D0\u05D5 \u05E2\u05DC\u05D5\u05DC\u05D5\u05EA \u05DC\u05D4\u05E4\u05E8 \u05D6\u05DB\u05D5\u05D9\u05D5\u05EA \u05D9\u05D5\u05E6\u05E8\u05D9\u05DD \u05DB\u05DC\u05E9\u05D4\u05DF - \u05DC\u05D0 \u05EA\u05D5\u05D1\u05DC\u05D8\u05E0\u05D4 \u05D5\u05D4\u05EA\u05DE\u05D5\u05E8\u05D4 \u05E9\u05E9\u05D5\u05DC\u05DE\u05D4 \u05E2\u05DC \u05D4\u05D1\u05DC\u05D8\u05EA\u05DF \u05DC\u05D0 \u05EA\u05D5\u05D7\u05D6\u05E8/\u05EA\u05D6\u05D5\u05DB\u05D4.</li><li>\u05E9\u05D9\u05E8\u05D5\u05EA \u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05DE\u05D5\u05D1\u05DC\u05D8\u05D5\u05EA \u05D6\u05D4 \u05DE\u05D5\u05E2\u05E0\u05E7 \u05E8\u05E7 \u05E2\u05DC \u05D1\u05E1\u05D9\u05E1 "\u05DB\u05DE\u05D5\u05EA \u05E9\u05D4\u05D5\u05D0" \u05D0\u05D5 "\u05E2\u05DC \u05E4\u05D9 \u05D6\u05DE\u05D9\u05E0\u05D5\u05EA, \u05DC\u05DC\u05D0 \u05DB\u05DC \u05D4\u05EA\u05D7\u05D9\u05D9\u05D1\u05D5\u05D9\u05D5\u05EA \u05DE\u05DB\u05DC \u05E1\u05D5\u05D2 \u05E9\u05D4\u05D5\u05D0, \u05D1\u05DE\u05D9\u05D3\u05D4 \u05D4\u05DE\u05E8\u05D1\u05D9\u05EA \u05D4\u05DE\u05EA\u05D0\u05E4\u05E9\u05E8\u05EA \u05E2\u05DC \u05E4\u05D9 \u05D7\u05D5\u05E7.  OLX \u05D0\u05D9\u05E0\u05D5 \u05DE\u05E1\u05E4\u05E7\u05DB\u05DC \u05D4\u05EA\u05D7\u05D9\u05D9\u05D1\u05D5\u05EA \u05D0\u05D5 \u05DE\u05E6\u05D2 \u05D0\u05D5 \u05E0\u05D5\u05D8\u05DC \u05E2\u05DC \u05E2\u05E6\u05DE\u05D5 \u05DB\u05DC \u05D0\u05D7\u05E8\u05D9\u05D5\u05EA \u05D0\u05D5 \u05D7\u05D1\u05D5\u05EA \u05D1\u05D0\u05E9\u05E8 \u05DC\u05D3\u05D9\u05D5\u05E7 \u05D0\u05D5 \u05DC\u05E9\u05DC\u05DE\u05D5\u05EA \u05E9\u05DC \u05D4\u05EA\u05D5\u05DB\u05DF \u05D4\u05DE\u05D5\u05E4\u05D9\u05E2 \u05D1\u05E9\u05D9\u05E8\u05D5\u05EA \'\u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05DE\u05D5\u05D1\u05DC\u05D8\u05D5\u05EA\'.</li></ul>',
    'featured_listings.Benefits': '\u05D4\u05D8\u05D1\u05D5\u05EA',
    'featured_listings.Benefits_content': '\u05D4\u05DE\u05D5\u05D3\u05E2\u05D4 \u05E9\u05DC\u05DA \u05DE\u05E7\u05D1\u05DC\u05EA \u05DE\u05D9\u05E7\u05D5\u05DD \u05D8\u05D5\u05D1 \u05D9\u05D5\u05EA\u05E8 \u05D4\u05D5\u05D3\u05D5\u05EA \u05DC\u05D4\u05D5\u05E4\u05E2\u05D4 \u05D1\u05D0\u05D6\u05D5\u05E8\u05D9 \'\u05D4\u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05D4\u05DE\u05D5\u05D1\u05DC\u05D8\u05D5\u05EA\', \u05DB\u05DE\u05EA\u05D5\u05D0\u05E8 \u05DC\u05DE\u05D8\u05D4. \u05D4\u05EA\u05DE\u05D5\u05E0\u05D5\u05EA \u05E9\u05DC\u05D4\u05DC\u05DF \u05DE\u05E6\u05D9\u05D2\u05D5\u05EA \u05D3\u05D5\u05D2\u05DE\u05D0\u05D5\u05EA \u05DC\u05E9\u05E0\u05D9\u05D9\u05DD \u05DE\u05D1\u05D9\u05DF \u05D4\u05E1\u05D5\u05D2\u05D9\u05DD \u05D4\u05D6\u05DE\u05D9\u05E0\u05D9\u05DD \u05E9\u05DC \'\u05DE\u05D5\u05D3\u05E2\u05D5\u05EA \u05DE\u05D5\u05D1\u05DC\u05D8\u05D5\u05EA\'.',
